package vc.zz.qduxsh.picassoprogress;

import android.support.v7.app.AppCompatActivity;
import android.os.Bundle;
import android.view.View;
import android.widget.ImageView;
import android.widget.ListView;
import android.widget.TextView;

import com.pnikosis.materialishprogress.ProgressWheel;

import java.io.File;
import java.util.ArrayList;

public class MainActivity extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
    }

    @Override
    protected void onStart() {
        super.onStart();

        findViewById(R.id.bt1).setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View v) {
                //清除机身内存中图片的缓存
                File cacheDir = AlxOk3ClientManager.createDefaultCacheDir(MainActivity.this);
                for(File f:cacheDir.listFiles())if(f.exists())f.delete();
            }
        });
        ListView listView = (ListView) findViewById(R.id.lv1);
        ArrayList<BlurImage> picList = new ArrayList(7);
        for(int i=0;i<demoUri.length;i++){
            BlurImage blurImage = new BlurImage();
            blurImage.url = demoUri[i];
            blurImage.base64BlurImage = demoBase64[i];
            picList.add(blurImage);
        }
        listView.setAdapter(new AlxListViewCommonAdapter<BlurImage>(this,R.layout.adapter_item,picList) {
            @Override
            public void convert(ViewHolder holder, int position, final BlurImage entity) {
                if(entity == null || entity.url == null)return;
                final ImageView iv1 = holder.getView(R.id.iv1);
                final ProgressWheel progressWheel = holder.getView(R.id.progress_wheel);
                final TextView tv1 = holder.getView(R.id.tv1);

                //显示模糊占位图而且带进度条的下载过程
                AlxPicassoUtils.displayImageProgress(entity.url,iv1,progressWheel,tv1,entity.base64BlurImage);
                //不使用模糊图片占位，普通图片做占位图，使用进度条提示
//                AlxPicassoUtils.displayImageProgress(entity.url,iv1,progressWheel,tv1);
            }
        });
    }

    /**
     * 存放图片信息的实体类
     */
    public static class BlurImage{
        String url;
        String base64BlurImage;
    }


    //加载图片的url
    String[] demoUri = {
            "http://pic107.nipic.com/file/20160817/4516668_124105472000_2.jpg",
            "http://pic109.nipic.com/file/20160914/4516668_215919019000_2.jpg",
            "http://pic108.nipic.com/file/20160901/4516668_210829551000_2.jpg",
            "http://pic109.nipic.com/file/20160909/4516668_153420589000_2.jpg",
            "http://pic109.nipic.com/file/20160913/4516668_122906842038_2.jpg",
            "http://pic107.nipic.com/file/20160826/958400_013346416000_2.jpg",
            "http://pic106.nipic.com/file/20160808/958400_223735949000_2.jpg",
            "http://pic106.nipic.com/file/20160816/958400_100610770000_2.jpg"
    };
    /**
     * 注意：下面这些是上面图片url的jpg格式的25x25的缩略图，用于模糊后占位，用Base64的方式转换成了字符串，通过AlxBitmapUtils里的方法可以转换为Bitmap
     * 这些信息应该是获取json字符串的时候同图片的URL一同获取过来而不是异步的去下载，这样才能作为占位图片显示在ImageView上
     */
    String[] demoBase64 = {
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            ""
    };
}
